import React, { useState } from 'react';

function QuestionnaireForm({ questionnaireState, setQuestionnaireState }) {
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);

  const handleNextClick = () => {
    setCurrentQuestionIndex(currentQuestionIndex + 1);
  };

  const handlePreviousClick = () => {
    setCurrentQuestionIndex(currentQuestionIndex - 1);
  };


  const handleCheckboxChange = (e) => {
    const { name, checked } = e.target;
    setQuestionnaireState({
      ...questionnaireState,
      [name]: checked,
    });
  };

  const handleRadioChange = (e) => {
    const { name, value } = e.target;
    setQuestionnaireState({
      ...questionnaireState,
      [name]: value,
    });
  };

  const handleRangeChange = (e) => {
    const { name, value } = e.target;
    setQuestionnaireState({
      ...questionnaireState,
      [name]: parseInt(value),
    });
  };

  const handleTrueFalseChange = (e) => {
    const { name, value } = e.target;
    setQuestionnaireState({
      ...questionnaireState,
      [name]: value === 'true',
    });
  };

  const questions = [
    // {
    //   type: 'range',
    //   label: 'Question One:',
    //   name: 'questionOne',
    //   min: 0,
    //   max: 10,
    //   value: questionnaireState.questionOne,
    //   onChange: handleRangeChange,
    // },

    {
        label: 'Question One:',
        elements: [
          {
            type: 'range',
            name: 'questionOne',
            min: 0,
            max: 10,
            value: questionnaireState.questionOne,
            onChange: handleRangeChange,
          },
          {
            type: 'checkbox',
            name: 'questionTwo',
            value: questionnaireState.questionTwo,
            onChange: handleCheckboxChange,
          },
        ],
      },
      

    // {
    //   type: 'checkbox',
    //   label: 'Question Two:',
    //   name: 'questionTwo',
    //   value: questionnaireState.questionTwo,
    //   onChange: handleCheckboxChange,
    // },
    {
      type: 'select',
      label: 'Question Three:',
      name: 'questionThree',
      value: questionnaireState.questionThree,
      onChange: handleRadioChange,
      options: [
        { value: '', label: 'Select an option' },
        { value: 'optionOne', label: 'Option One' },
        { value: 'optionTwo', label: 'Option Two' },
        { value: 'optionThree', label: 'Option Three' },
      ],
    },
    {
      type: 'radio',
      label: 'Question Four:',
      name: 'questionFour',
      options: [
        { value: 'true', label: 'True' },
        { value: 'false', label: 'False' },
      ],
      value: questionnaireState.questionFour,
      onChange: handleRadioChange,
    },
    {
      type: 'textarea',
      label: 'Question Five:',
      name: 'questionFive',
      value: questionnaireState.questionFive,
      onChange: handleTrueFalseChange,
    },
  ];

  const currentQuestion = questions[currentQuestionIndex];

    return (
    <div>
        <form>

        <div>
            <label>{currentQuestion.label}</label>
            {currentQuestion.elements.map((element, index) => (
                <div key={index}>
                {element.type === 'range' && (
                    <input
                    type="range"
                    name={element.name}
                    min={element.min}
                    max={element.max}
                    value={element.value}
                    onChange={element.onChange}
                    />
                )}
                {element.type === 'checkbox' && (
                    <input
                    type="checkbox"
                    name={element.name}
                    checked={element.value}
                    onChange={element.onChange}
                    />
                )}
                {/* Add additional elements here as needed */}
            </div>
            ))}
        </div>

        <div>
            <label>{currentQuestion.label}</label>
            {currentQuestion.type === 'range' && (
            <input
                type="range"
                name={currentQuestion.name}
                min={currentQuestion.min}
                max={currentQuestion.max}
                value={currentQuestion.value}
                onChange={currentQuestion.onChange}
            />
            )}

            {currentQuestion.type === 'checkbox' && (
            <input
                type="checkbox"
                name={currentQuestion.name}
                checked={currentQuestion.value}
                onChange={currentQuestion.onChange}
            />
            )}
 
            {currentQuestion.type === 'select' && (
            <select name={currentQuestion.name} value={currentQuestion.value} onChange={currentQuestion.onChange}>
                {currentQuestion.options.map((option) => (
                <option key={option.value} value={option.value}>
                    {option.label}
                </option>
                ))}
            </select>
            )}

            {currentQuestion.type === 'radio' && (
            <div>
                {currentQuestion.options.map((option) => (
                <label key={option.value}>
                    {option.label}
                    <input
                    type="radio"
                    name={currentQuestion.name}
                    value={option.value}
                    checked={currentQuestion.value === option.value}
                    onChange={currentQuestion.onChange}
                    />
                </label>
                ))}
            </div>
            )}

            {currentQuestion.type === 'textarea' && (
            <textarea name={currentQuestion.name} value={currentQuestion.value} onChange={currentQuestion.onChange} />
            )}
        </div>
        </form>

        <div>
        {currentQuestionIndex > 0 && (
            <button onClick={handlePreviousClick}>Previous</button>
        )}

        {currentQuestionIndex < questions.length - 1 && (
            <button onClick={handleNextClick}>Next</button>
        )}
        </div>
    </div>
    );
}

export default QuestionnaireForm;
